import React, { createContext,useState } from 'react'
import Main from './Main'

const Property = createContext()
 
const App = () => {

  const [mode, setmode] = useState(null)

  const toggle = () => {
setmode(!mode)
  }

  return (
    <div >

<Property.Provider value={{mode:mode,toggle:toggle}}>
<Main/>
</Property.Provider>

 
    </div>
  )
}

export default App
